import logo from './imgs/color_logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <div className="instructions">
        <p>Run out of study material?</p>
        <p>Type a math, chemistry, or physics homework problem below and we'll give you some more!</p>
      </div>
      <div className="search-bar">
        <input type="text" placeholder="Enter your search query" />
        <button>Search</button>
      </div>
    </div>
  );
}

export default App;
